// src/components/Navbar.js
// src/components/Navbar.jsx
// src/components/Navbar.jsx
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="bg-[#222831] text-[#EEEEEE] shadow-md">
      <div className="container mx-auto flex justify-between items-center py-4 px-6">
        
        {/* Logo */}
        <Link to="/" className="text-2xl font-bold text-[#00ADB5]">
          JobPortal
        </Link>

        {/* Navigation Links */}
        <div className="hidden md:flex space-x-8">
          <Link to="/jobs" className="text-[#EEEEEE] hover:text-[#00ADB5]">
            Jobs
          </Link>
          <Link to="/contact" className="text-[#EEEEEE] hover:text-[#00ADB5]">
            Contact Us
          </Link>
        </div>

        {/* Auth Links */}
        <div className="hidden md:flex space-x-4">
          <Link to="/login" className="text-[#00ADB5] hover:text-[#EEEEEE]">
            Login
          </Link>
          <Link to="/signup" className="bg-[#00ADB5] text-[#222831] px-4 py-2 rounded hover:bg-[#00ADB5]">
            Sign Up
          </Link>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
